import numpy as np
import matplotlib.pyplot as plt

# === Helper functions ===

def pad_to_length(arr, length):
    """Pad array to target length using the last trend direction."""
    arr = list(arr)
    while len(arr) < length:
        if len(arr) > 1:
            trend = arr[-1] - arr[-2]
        else:
            trend = 0
        arr.append(arr[-1] + trend)
    return np.array(arr[:length])

def moving_average(data, window_size):
    """Apply moving average smoothing."""
    return np.convolve(data, np.ones(window_size)/window_size, mode='same')

def plot_metric(data_dict, title, ylabel, window_size, filename_base):
    """Plot all agents' smoothed data, save as PNG and EPS, only show PNG."""
    plt.figure(figsize=(10, 6))
    markers = {
        'DDPG': ('b', 'v'),
        'TD3': ('g', 's'),
        'PPO': ('r', 'D'),
        'SAC': ('deepskyblue', 's'),
        'Greedy': ('orange', 'o'),
        'Random': ('k', 'x')
    }

    for name, values in data_dict.items():
        values = pad_to_length(values, 200)
        smoothed = moving_average(values, window_size)
        color, marker = markers[name]
        plt.plot(values, marker=marker, label=name, color=color, markersize=4)

    plt.xlabel('Episodes')
    plt.ylabel(ylabel)
    plt.title(title)
    plt.grid(True)
    plt.legend()
    plt.tight_layout()

    # Save as both PNG and EPS
    plt.savefig(filename_base + '.png', format='png', bbox_inches='tight')
    plt.savefig(filename_base + '.eps', format='eps', bbox_inches='tight')

    # Only show PNG plot
    plt.show()

    # Close figure to prevent EPS from showing again
    plt.close()
    plt.show()

